import React,{useState,useEffect} from 'react';
import axios from 'axios';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch,
  useParams
} from "react-router-dom";


const Detail = props => {
  const[detail, setDetail] = useState([])

  useEffect(()=>{
    axios.get(props.url)
    .then(res =>{
      setDetail(res.data)
      console.log(res.data);
    })
    .catch(err => {
      console.log(err)
    })
  },[])

  return(
    <div>
        <Abilities ability={detail.abilities}/>
    </div>
  )
}


const Abilities = props => {
  return (
    <div>
      {props.map(res=>(
        <p></p>
      ))}
    </div>
  )
}

export default Detail
